        children: "Thanks for applying to the Gratheon ML engineer volunteer position. I assume you aim to help bees and beekeepers have an easier life while working on cool tech like AI, IoT, robots and contributing to opensource community. You can read about our mission in Notion: https://gratheon.notion.site/Gratheon-fdac3638d55542ddb073ae90537cd5b5\n\nTo clarify, that this is not a paid position. We are is an infant startup (a team of 6) without investors backing us yet. We’ve had various hackathons and accelerators so far. The last one was http://prototron.ee/, where we got into top 25 out of 50 applicants.\n\nThe current status is - we have a web app that is open for anyone to register and try out at https://app.gratheon.com/ but it still needs lots of work\n\nOur code and internal docs are fully open source, and you’re encouraged to check them out on GitHub: https://github.com/Gratheon\n\nAs there are multiple candidates, and I'm not sure how best to evaluate you, so if you have time for a side project I suggest you to:\n\n1. Explore what you think is best you can do technically and what interests you the most out of our list of features we have in the backlog (you can filter by tags):\nhttps://gratheon.notion.site/Ideas-and-Features-ca76f493a1454e14b7dfbae7bd292a2e\n\nFor ML some of the challenges we have:\n- getting bee counting to work on a jetson nano or jetson orin using yolo v8/10 models and on video\n- gathering beekeeping related datasets and annotating them, for example hornet detection or drone bees\n- increasing precision for existing models\n\n2. Join Discord to discuss a specific feature you could work on, but which is not clear / not groomed yet: https://discord.gg/PcbP4uedWj\n\n3. Do some coding. Maybe follow onboarding first to have app running locally - https://gratheon.notion.site/Onboarding-91481a8152cf4d1685770ec2a7cc7c94 .\n\n4. Optionally, you can check out our past meeting recordings - https://gratheon.notion.site/All-hands-meeting-recordings-405d4ff10fc04cd4a57dc8ed9ef362a9?pvs=74\n\nWe try to do regular meetings if someone has topics to discuss. Feel free to explore Notion and I hope to hear back from you in the Discord.\n"
